import Head from "next/head";
import Layout, { siteTitle } from "../components/Layout";
import { getCocktailData } from "../lib/API";
// import utilStyles from "../styles/utils.module.css";
import CocktailsList from "../components/CocktailsList";
import mockData from "../mockData.json";
// import Search from "../components/search-box";

export async function getStaticProps() {
  const allCocktailsData = await getCocktailData();
  return {
    props: {
      allCocktailsData,
    },
  };
}

export default function Home({ allCocktailsData }) {
  return (
    <Layout home>
      <Head>â€¦</Head>

      <div className="hero col s12"></div>
      <div class="card-panel search">
        <div class="row">
          <div class="input-field col s6">
            <input value="" id="search" type="text" class="validate" />
            <label class="active" for="search">
              Search for a cocktail e.g. Negroni
            </label>
          </div>
        </div>
      </div>
      <CocktailsList drinks={mockData.drinks} />
      <style global jsx>{`
        .hero {
          background: url("/images/hero.jpg") no-repeat 0% 0%;
          background-size: cover;
          height: 100vh;
        }
        .search {
          position: absolute;
          top: 50%;
          left: 50%;
        }
      `}</style>
    </Layout>
  );
}
